DROP TABLE IF EXISTS `agreements_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `agreements_info` (
  `agreement_id` bigint unsigned NOT NULL COMMENT 'Договор',
  `date_of_conclusion` date NOT NULL COMMENT 'Дата заключения договора',
  `amount` bigint unsigned DEFAULT NULL COMMENT 'Сумма',
  `term` smallint unsigned DEFAULT NULL COMMENT 'Срок',
  `rate` double unsigned DEFAULT NULL COMMENT 'Размер процентной ставки',
  `interest_on_balance` double unsigned DEFAULT NULL COMMENT 'Начисление % на остаток',
  `planned_end_date_of_agreement` date DEFAULT NULL COMMENT 'Плановая дата окончания договора',
  `currency` enum('rur','usd','eur') DEFAULT NULL COMMENT 'Валюта',
  `user_id` int unsigned NOT NULL COMMENT 'Сотрудник, заключивший договор',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`agreement_id`),
  KEY `agreements_info_user_id_fk` (`user_id`),
  KEY `agreements_info_amount_idx` (`amount`),
  KEY `agreements_info_term_idx` (`term`),
  CONSTRAINT `agreements_info_agreement_id_fk` FOREIGN KEY (`agreement_id`) REFERENCES `agreements` (`id`),
  CONSTRAINT `agreements_info_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Информация по договору';
