/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `clients_info` (
  `client_id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор клиента',
  `gender` enum('M','F') NOT NULL COMMENT 'Гендер',
  `previous_first_name` varchar(100) DEFAULT NULL COMMENT 'Предыдущее имя',
  `previous_last_name` varchar(100) DEFAULT NULL COMMENT 'Предыдущая фамилия',
  `previous_patronymic` varchar(100) DEFAULT NULL COMMENT 'Предыдущее отчество',
  `passport_id` int unsigned NOT NULL COMMENT 'Текущий паспорт клиента',
  `home_phone_number` varchar(20) DEFAULT NULL COMMENT 'Домашний номер телефона',
  `contact_person_phone_number` varchar(20) DEFAULT NULL COMMENT 'Номер телефона контактного лица',
  `contact_person_name` varchar(250) DEFAULT NULL COMMENT 'Имя контактного лица',
  `email` varchar(100) DEFAULT NULL COMMENT 'Электронная почта клиента',
  `registration_address_id` int unsigned DEFAULT NULL COMMENT 'Идентфикатор адреса регистрации',
  `residence_address_id` int unsigned DEFAULT NULL COMMENT 'Идентификатор адреса проживания',
  `is_vip` tinyint(1) DEFAULT '0' COMMENT 'Признак особого статуса',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`client_id`),
  UNIQUE KEY `passport_id` (`passport_id`),
  KEY `clients_info_registration_address_id_fk` (`registration_address_id`),
  KEY `clients_info_residence_address_id_fk` (`residence_address_id`),
  KEY `clients_info_email_idx` (`email`),
  KEY `clients_info_previous_last_name_idx` (`previous_last_name`),
  CONSTRAINT `clients_info_client_id_fk` FOREIGN KEY (`client_id`) REFERENCES `clients` (`id`),
  CONSTRAINT `clients_info_passport_id_fk` FOREIGN KEY (`passport_id`) REFERENCES `passports` (`id`),
  CONSTRAINT `clients_info_registration_address_id_fk` FOREIGN KEY (`registration_address_id`) REFERENCES `adresses` (`id`),
  CONSTRAINT `clients_info_residence_address_id_fk` FOREIGN KEY (`residence_address_id`) REFERENCES `adresses` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Клиенты';
