CREATE TABLE `localities` (
  `id` smallint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор н/п',
  `name` varchar(200) NOT NULL COMMENT 'Название н/п',
  `region_id` tinyint unsigned NOT NULL COMMENT 'Регион',
  `district_id` smallint unsigned NOT NULL COMMENT 'Район',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `localities_region_id_fk` (`region_id`),
  KEY `localities_district_id_fk` (`district_id`),
  KEY `localities_name_idx` (`name`(12)),
  CONSTRAINT `localities_district_id_fk` FOREIGN KEY (`district_id`) REFERENCES `districts` (`id`),
  CONSTRAINT `localities_region_id_fk` FOREIGN KEY (`region_id`) REFERENCES `regions` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Населенные пункты';
