DROP TABLE IF EXISTS `passports`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `passports` (
  `id` int unsigned NOT NULL COMMENT 'Идентификатор паспорта',
  `series_id` smallint unsigned NOT NULL COMMENT 'Идентификатор серии',
  `number` mediumint unsigned NOT NULL COMMENT 'Номер паспорта',
  `date_of_issue` date NOT NULL COMMENT 'Дата выдачи',
  `division_code_id` smallint unsigned NOT NULL COMMENT 'Идентификатор кода подразделения',
  `place_of_birth` text NOT NULL COMMENT 'Место рождения',
  `passport_photo_id` bigint unsigned NOT NULL COMMENT 'Фото паспорта',
  `registration_photo_id` bigint unsigned NOT NULL COMMENT 'Фото страницы с регистрацией',
  `is_valid` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Признак действительности',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`series_id`,`number`) COMMENT 'Составной ПК серия и номер паспорта',
  UNIQUE KEY `id` (`id`),
  KEY `passports_division_code_id_fk` (`division_code_id`),
  KEY `passports_passport_photo_id_fk` (`passport_photo_id`),
  KEY `passports_registration_photo_id_fk` (`registration_photo_id`),
  CONSTRAINT `passports_division_code_id_fk` FOREIGN KEY (`division_code_id`) REFERENCES `division_codes` (`id`),
  CONSTRAINT `passports_passport_photo_id_fk` FOREIGN KEY (`passport_photo_id`) REFERENCES `photos` (`id`),
  CONSTRAINT `passports_registration_photo_id_fk` FOREIGN KEY (`registration_photo_id`) REFERENCES `photos` (`id`),
  CONSTRAINT `passports_series_id_fk` FOREIGN KEY (`series_id`) REFERENCES `series` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Паспорта';
/*!40101 SET character_set_client = @saved_cs_client */;

