CREATE TABLE `users` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор сотрудника',
  `first_name` varchar(100) NOT NULL COMMENT 'Имя сотрудника',
  `last_name` varchar(100) NOT NULL COMMENT 'Фамилия сотрудника',
  `patronymic` varchar(100) DEFAULT NULL COMMENT 'Отчество сотрудника',
  `department_id` smallint unsigned NOT NULL COMMENT 'Код департамента/отдела',
  `position_id` smallint unsigned NOT NULL COMMENT 'Код должности',
  `current_employee` tinyint(1) DEFAULT '1' COMMENT 'Признак трудосутройства',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `users_department_id_fk` (`department_id`),
  KEY `users_position_id_fk` (`position_id`),
  KEY `users_last_name_first_name_patronymic_idx` (`last_name`,`first_name`,`patronymic`),
  CONSTRAINT `users_department_id_fk` FOREIGN KEY (`department_id`) REFERENCES `departments` (`id`),
  CONSTRAINT `users_position_id_fk` FOREIGN KEY (`position_id`) REFERENCES `positions` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Сотрудники';
